import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App.js";
import Form from "./routes/Form.js"
import { createContext } from "react";
const [ongoingstyle, setongoingstyle] = useState({})
const [epiredstyle, setonexpired] = useState({})
const [completedstyle, setcompletedstyle] = useState({})
const ctxt = createContext()
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import ErrorPage from "./routes/errorpage.js";
const router = createBrowserRouter([
  {
    path: "/",
    element: <App/>,
    errorElement: <ErrorPage/>
  },
  {
    path: "/Sign",
    element: <Form />
}
]);


const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <ctxt.Provider value={[ongoingstyle, setongoingstyle], [epiredstyle, setonexpired]}>
    <RouterProvider router={router}/>
    </ctxt.Provider>
  </React.StrictMode>
);
